with open('concurs.in') as f_in, open('concurs.out', 'w') as f_out:
    h_city, h_school, h_pupil = map(int, f_in.readline().strip())
    num_awards = int(f_in.readline().strip())
    awards = set()
    for award in f_in.readline().strip().split(' '):
        awards.add(int(award))

    if h_city*100+h_school*10+h_pupil in awards:
        f_out.write('DA\n')
    else:
        f_out.write('NU\n')

    f_out.write(
        str(
            sum(
                1 
                for award in awards 
                if int(str(award)[0])==h_city
            )
        )
        + '\n'
    )

    f_out.write(
        str(
            sum(
                1 
                for award in awards 
                if int(str(award)[0:2])==h_city*10+h_school
            )
        )
        + '\n'
    )
